import React from "react";
import "./Weather.css"


export default function Weather() {
    return (
      <div className="Weather">
        <h1>Lviv</h1>
        <ul>
          <li>Wendsday 11:55</li>
          <li>Mostly cloudy</li>
        </ul>
      </div>
    );
}
